Field.bounds = {
    north = segment.new(Field.corners.northWest, Field.corners.northEast),
    south = segment.new(Field.corners.southWest, Field.corners.southEast),
    west = segment.new(Field.corners.southWest, Field.corners.northWest),
    east = segment.new(Field.corners.southEast, Field.corners.northEast),
}

function Field.isInside(position)
    return math.cmpf(math.abs(position.x), Field.halfWidth) <= 0 and math.cmpf(math.abs(position.y), Field.halfLength) <= 0
end

function Field.forceInside(position)
    return vector2.new(math.clamp(position.x, -Field.halfWidth, Field.halfWidth), math.clamp(position.y, -Field.halfLength, Field.halfLength))
end

function Field.isInsideEx(position, delta)
    return math.cmpf(math.abs(position.x), Field.halfWidth - delta) <= 0 and math.cmpf(math.abs(position.y), Field.halfLength - delta) <= 0
end

function Field.isInsideExXY(position, deltaX, deltaY)
    return math.cmpf(math.abs(position.x), Field.halfWidth - deltaX) <= 0 and math.cmpf(math.abs(position.y), Field.halfLength - deltaY) <= 0
end

function Field.forceInsideEx(position, delta)
    return vector2.new(math.clamp(position.x, -Field.halfWidth + delta, Field.halfWidth - delta), math.clamp(position.y, -Field.halfLength + delta, Field.halfLength - delta))
end

function Field.isInGoal(position)
    return math.cmpf(math.abs(position.x), Field.halfGoalWidth) <= 0
end

function Field.getIntersectPoint(seg, endPosition)
    local nearestPosition, minSqrDistance = nil, math.huge

    for k, bound in pairs(Field.bounds) do
        local intersectPoint = geometry.intersectPoint(seg, bound)

        if intersectPoint ~= nil then
            local sqrDistance = vector2.sqrdist(intersectPoint, endPosition)
            if math.cmpf(sqrDistance, minSqrDistance) < 0 then
                nearestPosition = intersectPoint
                minSqrDistance = sqrDistance
            end
        end
    end

    return nearestPosition
end

function Field.isInCenterDirectFreeKickArea(foulPosition, sign)
    local transformedFoulPosition = foulPosition * -sign

    return math.cmpf(math.abs(transformedFoulPosition.x), 20.16) <= 0 and math.cmpf(transformedFoulPosition.y, 22.5) >= 0 and math.cmpf(transformedFoulPosition.y, 38.5) <= 0
end

function Field.isInWingDirectFreeKickArea(foulPosition, sign)
    local transformedFoulPosition = foulPosition * -sign

    return math.cmpf(transformedFoulPosition.y, 35) >= 0 and math.cmpf(math.abs(transformedFoulPosition.x), 20.16) >= 0
end

function Field.isInForceCounterAttackArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 15) >= 0
end

function Field.isInPenaltyArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 20.16) <= 0 and math.cmpf(transformedPosition.y, 38.5) >= 0
end

function Field.isInNormalGkArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 9) <= 0 and math.cmpf(transformedPosition.y, 44) >= 0
end

function Field.isInGkHighInterceptArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 20.16) <= 0 and math.cmpf(transformedPosition.y, 40.5) >= 0
end

function Field.isInDivingArea(position, sign)
    return Field.isInPenaltyArea(position, sign) or Field.isInCenterDirectFreeKickArea(position, sign) or Field.isInWingDirectFreeKickArea(position, sign)
end

function Field.isInLargeStepDribbleCatchArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 40) <= 0 and math.cmpf(transformedPosition.y, -15) >= 0
end

function Field.isInCatchPassArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, -10) >= 0
end

function Field.isInCornerKickTargetArea(position, ballPosition)
    return math.cmpf(math.abs(position.x - ballPosition.x), 53.84) <= 0 and math.cmpf(math.abs(position.y - ballPosition.y), 16.5) <= 0
end

function Field.isInWingFreeKickTargetArea(position, ballPosition)
    return math.cmpf(math.abs(position.x), 20.16) <= 0 and math.cmpf(position.y * math.sign(ballPosition.y), 30) >= 0
end

function Field.isInForceShootArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 12.5) <= 0 and math.cmpf(transformedPosition.y, 38.5) >= 0
        and math.cmpf(0.577 * math.abs(position.x) + transformedPosition.y - 55, 0) <= 0
end

function Field.isInSideFForceShootArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 16.5) <= 0 and math.cmpf(transformedPosition.y, 33) >= 0
        and math.cmpf(0.577 * math.abs(position.x) + transformedPosition.y - 55, 0) <= 0
end

function Field.isInThroughBallForceShootArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 16) <= 0 and math.cmpf(transformedPosition.y, 35) >= 0
        and math.cmpf(0.577 * math.abs(position.x) + transformedPosition.y - 55, 0) <= 0
end

function Field.isInHighSpeedPassArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(math.abs(position.x), 27.5) <= 0 and math.cmpf(transformedPosition.y, 25) >= 0
end

function Field.isInRapidDribbleArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 30) >= 0
end

function Field.isInDribbleAdjustArea(position)
    return math.cmpf(math.abs(position.y), 15) <= 0
end

function Field.isInEnemyArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 0) >= 0
end

function Field.isInFillInArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 15) >= 0
end

function Field.isInFrontCourtArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.y, 25) >= 0
end

function Field.isInLeftCourtArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.x, 0) <= 0
end

function Field.isInRightCourtArea(position, sign)
    local transformedPosition = position * -sign
    return math.cmpf(transformedPosition.x, 0) >= 0
end

function Field.isInCuttingOrToCornerArea(position, sign)
