function Field.getRandomThrowInCoordinateAthletePosition(centerPoint, minRadius, maxRadius)
    local r = math.randomInRange(minRadius, maxRadius)
    local baseVector = {x = 0, y = r}
    local targetPosition = nil

    repeat
        local rotateRad = math.randomInRange(1/6 * math.pi, 5/6 * math.pi)
        local targetVector = math.cmpf(centerPoint.x, 0) > 0 and vector2.rotate(baseVector, rotateRad) or vector2.rotate(baseVector, -rotateRad)
        targetPosition = centerPoint + targetVector
    until Field.isInside(targetPosition)

    return targetPosition
end

function Field.getAreaId(position, sign)
    local transformedPosition = position * -sign
    if math.cmpf(-32, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, -20) <= 0 and
        math.cmpf(30, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 50) <= 0 then
        return 1
    elseif math.cmpf(-20, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, -9) <= 0 and
        math.cmpf(45, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 50) <= 0 then
        return 2
    elseif math.cmpf(-20, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, -9) <= 0 and
        math.cmpf(37.5, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 45) <= 0 then
        return 3
    elseif math.cmpf(-20, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, -9) <= 0 and
        math.cmpf(30, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 37.5) <= 0 then
        return 4
    elseif math.cmpf(-9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 9) <= 0 and
        math.cmpf(45, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 50) <= 0 then
        return 5
    elseif math.cmpf(-9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 9) <= 0 and
        math.cmpf(37.5, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 45) <= 0 then
        return 6
    elseif math.cmpf(-9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 9) <= 0 and
        math.cmpf(30, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 37.5) <= 0 then
        return 7
    elseif math.cmpf(9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 20) <= 0 and
        math.cmpf(45, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 50) <= 0 then
        return 8
    elseif math.cmpf(9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 20) <= 0 and
        math.cmpf(37.5, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 45) <= 0 then
        return 9
    elseif math.cmpf(9, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 20) <= 0 and
        math.cmpf(30, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 37.5) <= 0 then
        return 10
    elseif math.cmpf(20, transformedPosition.x) <= 0 and math.cmpf(transformedPosition.x, 32) <= 0 and
        math.cmpf(30, transformedPosition.y) <= 0 and math.cmpf(transformedPosition.y, 50) <= 0 then
        return 11
    end
end

return Field
